import React from "react";

export function getStaticProps() {
  const template =
    '<div id="rsg-root"></div><script src="/build/bundle.js"></script>';
  return template;
}
function Docs({
  template = html`<p>Remember to run <blockquote>cd docs && npm run build</blockquote></p>`,
}) {
  return <div dangerouslySetInnerHTML={{ __html: `${template}` }} />;
}

export default Docs;
